{'es-ES': 'Vivienda adosada, distribuida en 3 dormitorios, armarios empotrados,  salón comedor, cocina amueblada con electrodomésticos, 2 baños, patio de unos 20 m2 con toldo, terraza amplia techada, garaje privado, aire acondicionado, en zona de parques. Mejor Ver

En cumplimiento del decreto de la junta de Andalucía 218/2005 del 11 de Octubre, se le informa al cliente que los gastos notariales, registrales, ITP, honorarios de la agencia y otros gastos inherentes a la compraventa no están incluidos en el precio.
'}

{'es-ES': 'Piso en planta baja en Isla Cristina, se distribuye en salón, cocina con salida a un patio, baño y dos dormitorios.

Precio negociable.

Posibilidad de financiar hasta el 100 %[IW]'}

{'es-ES': '¡¡¡OBRAS AL 70% 2 ÚLTIMOS ADOSADOS!!! ENTREGA 2º TRIMESTRE 2022, en zona centro de Punta Umbría, zona muy tranquila, entre la calle ANCHA y la calle FRAGATA, con magníficas calidades, preinstalación de aire acondicionado, instalación de ACS mediante Aerotermia, exteriores y muy luminosas todas las viviendas, con opción de garaje y trastero. Las viviendas se encuentran distribuidas en dos plantas y solarium o cubierta visitable, con acceso independiente para cada vivienda. 					


PLANTA BAJA: amplia cocina AMUEBLADA, patio con ducha exterior, integrada en fantástico salón comedor, TERRAZA y aseo. PLANTA 1ª: 3 dormitorios con armarios empotrados y  baño completo. PLANTA CUBIERTA: castillete y 45 m2. de amplia terraza-solarium. PLANTA SEMI-SÓTANO: amplios garajes de 6`50 m. y 7`20 m. de largo, y amplios trasteros (OPCIONALES).  ¡¡¡Posibilidad de financiación al 100%!!! ACEPTAMOS INMUEBLES COMO PARTE DE PAGO. HONORARIOS DE LA INMOBILIARIA SON DEL 1’5%   IMPUESTOS (I.V.A.)					


'}

{'es-ES': 'PROMOCIÓN CONJUNTA DE 2 VIVIENDAS EN GIBRALEON CON UN PRECIO DE: 63.900 &euro; Y 70.000 &euro; RESPECTIVAMENTE Y NO SE PUEDEN VENDER POR SEPARADO.

2 Viviendas que se distribuyen en salón-comedor, cocina, 3 dormitorios y de 1 baños.
Se localizan en el centro de la población, a 260 metros del ayuntamiento y próximas a superfícies comerciales.'}

{'es-ES': 'Este precioso adosado es como una cajita de bombones, dulce y agradable. Su ubicación es perfecta al encontrarse en una zona tranquila de Cartaya y con muy buena comunicación con los accesos a la autovía. En la planta baja encontramos un salón comedor y una magnífica cocina, que se entrega totalmente equipada y amueblada, con placa de inducción, campana extractora y lavavajillas. También hay un pequeño patio y un aseo. En la planta superior encontramos dos dormitorios con fabulosos roperos empotrados, un baño y un tercer dormitorio que podríamos utilizar como despacho.

 La vivienda dispone alarma con sensores de movimiento, aire acondicionado en el salón y el dormitorio, ventanas con climalit, mosquiteras y rejas.

 No lo pienses más y llámanos para concertar una cita. Este precioso adosado puede convertirse en tu próximo hogar.'}

{'es-ES': 'Piso situado en C/ Aragón en Bollullos Par del Condado. Esta ubicado en 1ª planta del edificio. Tiene una superficie útil de 103 m2. Distribuido en salón, cocina, 3 dormitorios y 1 baño. Es un piso muy luminoso, exterior. Esta en buen estado.

 Sin comisión inmobiliaria.

 ¡Consúltanos y solicita una visita! - 955 275 601'}

{'es-ES': 'Piso céntrico y de gran amplitud (160 m2), de 3 dormitorios y 2 baños. Muy luminoso gracias a sus cuatro balcones. Estancias muy amplias, con techos altos. Aire acondicionado en salón, cocina y dormitorios.

Vivienda distribuida de la siguiente manera: planta baja de 25 m2, que alberga un garaje particular y la escalera de acceso al piso. Planta primera de 160 m2 destinada a la vivienda (piso). Planta alta de 42 m2 que ofrece un ático abuhardillado y una azotea practicable. 

Orientación Norte-Sur, con balcones a dos calles (Teniente Merchante y Dolores). Un lugar tranquilo y cómodo para vivir.'}

{'es-ES': 'SIN GASTOS DE INMOBILIARIA AL COMPRADOR

Vivienda situada en Palmeras Golf II de Islantilla, es una de las urbanizaciones más nuevas del campo de Golf de Islantilla, a parte de ser de las más nuevas también es de las más completas con 14.000 metros de zona común, tiene dos piscinas enormes rodeada de zona verde, bar-chiringuito dentro de la misma urbanización, zona infantil, gimnasio al aire libre, pistas de padel y  a tan solo 12 minutos a pie de la Playa Central de La Antilla. 

El piso tiene una buena distribución con dos dormitorios con armarios empotrados, baño completo, cocina independiente, salón-comedor con salida a la terraza y en el sótano cuenta con un parking asignado.'}

{'es-ES': 'Tecnocasa vende fantástico piso en Calle Ancha, en pleno centro de Punta Umbía.

Se trata de una primera planta sin ascensor, con escaleras muy cómodas. Tiene aproximadamente 80m2, distribuidos en 3 dormitorios, 1 baño, salón-comedor con amplio balcón, cocina y patio. El baño se encuentra completamente reformado. Sin amueblar.

Calle peatonal, rodeada de todo tipo de servicios, a 10 minutos de la playa y a 2 minutos de la Ría! Ven a visitarlo sin compromiso!'}

{'es-ES': 'RFA.2546  ¿Quieres comprar casa/chalet/adosado de 6 habitaciones en una de las mejores zonas de Huelva?, "El Alto del Conquero". Esta magnifica casa adosada se encuentra en condiciones de ser tu sueño buscado, consta de 244 metros cuadrados y, 70 de parcela y patio. Excelente oportunidad de adquirir en propiedad esta casa/chalet residencial. Cuenta con cocina completamente equipada, dando acceso a la terraza y zona lavadero, el salón tiene chimenea, destaca por su amplitud, elegancia como es resto de todas las piezas de la casa, en la zona delantera tiene una amplia terraza con entrada para vehículos, siendo esta una gran ventaja. ubicado en la localidad de Huelva capital, a escasos metros Del instituto femenino y otros tantos más de gran interés.   ¿Quieres más información?. No dudes en ponerte en contacto con nosotros. Visita sin compromiso. Más información rellenando el formulario de contacto o por teléfono. Estaremos encantados de atenderte. 

 * VENTAJAS. Aire acondicionado, armarios empotrados. Excelentes calidades, Garaje techado, amplias zonas, barrio histórico de Huelva y Catalogado Bien de Interés Cultural. Los accesos. se encuentran reformados recientemente. Proximidades; El Corte Ingles, Teresianas y otros colegios, Supermercados, Lineas de bus, Taxis, Cafeterías, Academias...,* Exento de IBI y Tasa de Residuos."  ¡¡Todo son ventajas!!
'}

{'es-ES': 'Ubicación ideal para vivir todo el año o para vacaciones , a 300 mts de la playa y 100 de avenida Carnaval , entorno rodeado de colegios, institutos , pabellón de deportes y todo tipo de comercios necesarios para la vida cotidiana.
El piso está en 3º planta sin ascensor, consta de tres dormitorios muy amplios con 2 armarios empotrados, baño completo, cocina muy amplia con zona de mesa y sillas, gran salón con  chimenea y acceso a balcón. Aire acondicionado en salón y dos dormitorios. Comunidad de sólo 6 vecinos, 2 por planta. Piso muy luminoso, amplio y alegre, listo para entrar a vivir !!!!!!                                      Solicita visita en 633066980.

  + Isla Cristina, donde se une naturaleza y  playas, una ciudad con una tradición marinera, donde se puede degustar el pescaito y el marisco recién capturado, caminar a lo largo de kilómetros de playas de arena blanca, conocer el proceso de la sal en las marismas, pasar un gran día en de áreas de picnic por los hermosos pinares,  rutas en barco a lo largo del río, deportes acuáticos como surf, remo, kitesurf ... con Puerto Deportivo y Pesquero, Campo de Golf a 7 km y solo 20 km del país vecino, Portugal.[IW]'}

{'es-ES': 'VENTA INMOBILIARIA PACO TENORIO APARTAMENTO TORRE GOYA EN LA ANTILLA.

Apartamento de 2 dormitorios y 1 baño con terraza. Incluye plaza de aparcamiento. Se trata de una tercera planta con ascensor. El apartamento cuenta con un luminoso salón, con mesa comedor y gran ventanal comunicada con la terraza cerrada. Cocina luminosa y equipada. El baño se encuentra totalmente reformado, con plato de ducha y sistema de agua caliente sanitaria eléctrica. Ambos dormitorios son exteriores, amplios y con armarios empotrados. Además, el dormitorio principal dispone de cable de antena para TV. Incluye plaza de aparcamiento.
El bloque está situado a pocos minutos de la Avenida Castilla, cerca de restaurantes y comercios.'}

{'es-ES': 'Amplio y luminoso piso en una de las mejores ubicaciones de Huelva.
Consta de 4 dormitorios, dos de ellos con armarios empotrados, 2 cuartos de baño, salón comedor y cocina.

'}

