{'es-ES': 'CONJUNTO APARTAMENTOS PLAYA MARINA:

Fabuloso Apartamento en de 119m2 de superficie, con terraza de 14 m2 en primera línea de playa. Este apartamento cuanta con 2 dormitorios y 2 baño, con cocina y salón en sus zonas comunes este residencial presenta área deportiva. Su plaza de garaje es bastante amplia por su ubicación dentro del parking comunitario.
Este inmueble se encuentra a tan sólo 1 min de la playa y 2 min de la zona de ocio de Punta del Moral y del puerto deportivo, debido a su enclave podrás disfrutar de un paraje natural como Isla Canela en sus 8 kms de playa de arena fina blanca ininterrumpidos, nuestra gastronomía y nuestros parajes de marismas en un entorno de dos desembocaduras, Rio Guadiana por Portugal y Rio Carrera por Isla Cristina.'}

{'es-ES': 'Magnífica vivienda en punta umbría, muy próxima de calle ancha, dispone de 2 dormitorios con armarios empotrados, baño, salón y cocina.


Inmueble procedente de entidad bancaria en periodo de pujas ( wow ). Posibilidad de financiación 100%.

Sin gastos de comisión inmobiliaria.'}

{'es-ES': 'VENTA INMOBILIARIA PACO TENORIO APARTAMENTO BLOQUE 17 EN AVENIDA CASTILLA, LA ANTILLA.

Apartamento de 2 dormitorios y 1 baño en plena Avenida Castilla en La Antilla. Se trata de una 4ª planta con ascensor. Cuenta con un salón luminoso con mesa comedor y comunicado con una amplia terraza con impresionantes vistas al mar. La cocina está totalmente reformada, equipada con horno y lavadora. Ambos dormitorios son exteriores y con armarios empotrados. Baño completo con luz natural, cuenta con plato de ducha y bidet. 
Situado en pleno corazón de La Antilla, con comercios de alimentación, restaurantes y ocio, y a unos 150 metros de la playa.'}

