{'es-ES': 'RFA.2636 TEL 959258489. CASA EN VILLABLANCA, PROXIMO A PORTUGAL

Estupenda casa chalet individual en el mismo pueblo de Villablanca, 3 habitaciones, 2 baños, salon con chimenea, zona de barbacoa exterior zona de aparcamiento privada con posibilidad de meter varios coches. Gracias a su ubicacion la casa recibe gran parte del dia mucho sol, con vistas abierta al jardin y las montañas se divisan desde el jardín, situada a tan solo 3 minutos del centro del pueblo, tiene muy buen acceso a la carretera provincial que da acceso a la autovía de Sevilla a Portugal, esta en una zona muy tranquila donde se puede disfrutar de vivir en el pueblo y al lado de la naturaleza y al mismo tiempo esta muy cerca de las localidades Españolas de Ayamonte y Villa Real de San ANTONIO, (Portugal). Tiene una parcela de unos 112 m2 y dentro de ella se encuentra la Casa con 107 m2 construidos en una sola planta y esta distribuida de la siguiente forma. Hall de entrada, salon con chimenea, cocina, 3 dormitorios con 2 banos Tambien tiene una puerta de salida desde la cocina a Ulla parte trasera de la parcela donde se puede disfrutar de maravillosas vistas a la naturaleza. Con un amplio espacio para poder dejar como jardín.
'}

{'es-ES': 'Vivienda situada en un barrio bastante conceptuado de la ciudad de Ayamonte, a solamente cinco minutos de la zona centro y cercana a todo tipo de comercios y de las principales vías de acceso a Ayamonte.
Esta propiedad se compone de dos plantas distribuidas en porche de entrada, cuatro dormitorios, dos baños, cocina independiente con despensa, salón con chimenea y acceso al patio que a su vez accede al garaje con capacidad para un vehículo.

¡¡ VENGA A VISITAR SIN COMPROMISO !!'}

{'es-ES': 'Vivienda unifamiliar adosada en dos plantas. La planta baja consta de aseo, cocina amueblada y equipada y salón comedor con salida a la terraza y los jardines de la urbanización. La planta alta se distribuye en un discreto dormitorio simple con armario empotrado, baño completo con placa de ducha y dormitorio principal con armario empotrado y terraza solárium.

 La urbanización se encuentra ubicada en una zona tranquila de Isla Cristina, en un conjunto de viviendas adosadas y pareadas a 200m de la ría Carreras y del Paraje Natural Marismas de Isla Cristina, y a tan solo 500m de la Playa Central. Próxima a un bosque de pinares, está muy bien comunicada a 8 km de la Autopista y a 18 km de la frontera con Portugal. En sus inmediaciones hay supermercados y acceso a un carril bici, y podrá llegar en 10 min. andando al centro de la localidad.

 Precio venta publico (pvp). Los gastos de notaría, registro e impuestos por la compra y financiación y honorarios de intermediación inmobiliaria 3% mas IVA. No están Incluidos, F. I. A. (Ficha Informativa Abreviada) a disposición del consumidor.'}

