Volviendo a las escaleras, éstas de madera  y con barandilla bicolor, accedemos a la primera planta donde se distribuyen los 
 3 dormitorios,  (ninguno con armarios empotrados), el baño, éste es exterior, con bañera y sin bidé y una terraza;
